import React from "react";

const divStyle = {
  textAlign: "center",
};

const ToDoInstruction = () => {
  return (
    <div style={divStyle}>
      <h3>
        What to do when you are worried that you might be infected with the
        novel coronavirus (COVID-19)
        <a href="https://japan2.usembassy.gov/pdfs/covid19-what-to-do-e.pdf">
          English
        </a>
        <a href="https://japan2.usembassy.gov/pdfs/covid19-what-to-do-j.pdf">
          Japanese
        </a>
      </h3>
    </div>
  );
};

export default ToDoInstruction;
